import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import { Button, Container } from "@mui/material";

// Example cover image import (replace with your actual image)
import coverImage from "../../images/developerCover.png"; // Adjust path accordingly

const BuildOnAlkebuleum = () => {
  return (
    <Box sx={{ py: 10, bgcolor: "white", position: "relative" }} id="buildonalkebuleum">
      {/* Developer Tag */}
      <Box
        sx={{
          position: "absolute",
          top: 10,
          left: 20,
          backgroundColor: "#E0E0E0", // Light gray for a subtle tag
          color: "#333", // Darker text for contrast
          px: 3,
          py: 1,
          borderRadius: "20px",
          fontSize: "14px",
          fontWeight: "bold",
          textTransform: "uppercase",
        }}
      >
        Developers
      </Box>

      <Container maxWidth="lg">
        <Grid container spacing={5} alignItems="center" justifyContent="center">
          {/* Left Side: Cover Image */}
          <Grid item xs={12} md={6}>
            <Box
              component="img"
              src={coverImage}
              alt="Build on Alkebuleum"
              sx={{
                width: "80%",  // Reduced width to 80% as in previous section
                height: "auto",
                borderRadius: "8px",
                boxShadow: "0px 4px 12px rgba(0, 0, 0, 0.1)",
              }}
            />
          </Grid>

          {/* Right Side: Content */}
          <Grid item xs={12} md={6}>
            <Typography
              variant="h4"
              component="h2"
              sx={{ fontWeight: "bold", mb: 3, color: "#333", textAlign: { xs: "center", sm: "left" } }}
            >
              Build on Alkebuleum
            </Typography>

            {/* Description Content */}
            <Typography
              variant="body1"
              color="textSecondary"
              sx={{ mb: 4, lineHeight: 1.7, textAlign: { xs: "center", sm: "left" } }}
            >
              Alkebuleum provides the perfect platform for developers to create decentralized applications that address
              real-world challenges. Here are a few examples of the types of projects you can build:
            </Typography>

            <Typography
              variant="body1"
              color="textSecondary"
              sx={{ mb: 2, textAlign: { xs: "center", sm: "left" } }}
            >
              - Decentralized Finance (DeFi) platforms to help underbanked communities.
            </Typography>

            <Typography
              variant="body1"
              color="textSecondary"
              sx={{ mb: 2, textAlign: { xs: "center", sm: "left" } }}
            >
              - Transparent supply chain management systems for industries.
            </Typography>

            <Typography
              variant="body1"
              color="textSecondary"
              sx={{ mb: 4, textAlign: { xs: "center", sm: "left" } }}
            >
              - Social impact platforms that leverage blockchain to solve societal issues.
            </Typography>

            {/* Call-to-Action Button */}
            <Box sx={{ textAlign: { xs: "center", sm: "left" } }}>
              <Button
                component="a"
                href="/learn-more"  // Replace with actual learn more link
                variant="contained"
                sx={{
                  backgroundColor: "#C19A6B",
                  color: "white",
                  padding: "10px 24px",
                  fontSize: "16px",
                  borderRadius: "8px",
                  "&:hover": {
                    backgroundColor: "#5a7a5b",
                  },
                }}
              >
                Learn More
              </Button>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
};

export default BuildOnAlkebuleum;
